const ExperienceItem = ({ title, company, duration, children }) => (
    <div className="relative pl-10 pb-10 border-l-2 border-slate-700 last:border-l-transparent">
        <div className="absolute -left-3.5 top-0 w-6 h-6 bg-slate-900 border-2 border-teal-400 rounded-full flex items-center justify-center">
             <div className="w-3 h-3 bg-teal-400 rounded-full"></div>
        </div>
        <span className="bg-teal-400 text-slate-900 text-xs font-bold px-2 py-1 rounded-full absolute -top-3 right-0 md:right-auto md:left-12">{duration}</span>
        <h3 className="text-2xl font-bold text-white">{title}</h3>
        <p className="text-teal-400 mb-4">{company}</p>
        <ul className="text-gray-400 list-none pl-0 space-y-2">
            {children}
        </ul>
    </div>
);

export default ExperienceItem;
